import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Test1() {
    const [article,setArticle] = useState('');
  useEffect(() => {
    axios
      .get('http://hn.algolia.com/api/v1/search?query=')
      .then((res) => {
        setArticle(res.data.hits)
      });
  }, []);
  return (
    <div>
      <input type="text" />
      <button>search</button>
      <table>
          <thead>
              <tr>
                  <th>ID</th>
                  <th>Author</th>
                  <th>Comments</th>
                  <th>Title</th>
                  <th>URL</th>
                  <th>remove</th>
              </tr>
          </thead>
          {console.log(article)}
          {[...article].map((item)=>(
            <tbody>
                <tr>
                    <tb>{item.objectID}</tb>
                    <tb>{article.author}</tb>
                    <tb>{article.comments}</tb>
                    <tb>{article.title}</tb>
                    <tb>{article.url}</tb>
                    <tb>remove</tb>
                </tr>
            </tbody>
          ))}
      </table>
    </div>
  );
}

export default Test1;
